import React, { Component } from 'react'
import moment from 'moment'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Card from 'react-bootstrap/Card'
import Table from 'react-bootstrap/Table'

import NavbarRadnik from '../NavbarRadnik'
import axios from 'axios';



const today = moment().format('YYYY-MM-DD')
class RadnikPregledRez extends Component {
    constructor(props) {
        super(props)
          this.state = {
            data: []
                  }
                }           
/*    
  state = {
    selectedDate: today,
    nights: '',
    noOfRooms: '',
    roomType: '',
    occupied: '',
    availableRooms: [],
    roomTypes: [],
    availableChecked: true,
    occupiedChecked: false
  }*/

  componentDidMount(){
    //get request
    axios.get('http://localhost/save.php').then(res => 
    {
    
    this.setState({data: res.data});
       }); 
  }



  

  render () {
    return (
      <>
      <NavbarRadnik/>
      <div className="maincontainer">
       
        <h1 className="mr-5 ml-5 mt-5">Therichpost.com</h1>
        <div className="container mb-5 mt-5 text-left">
        
        <table class="table table-hover">
          <thead>
            <tr>
              <th>ID</th>
              <th>Email</th>
              <th>Username</th>
            </tr>
          </thead>
          <tbody>
          {this.state.data.map((result) => {
            return (
             
                 <tr>
                  <td>{result.id}</td>
                  <td>{result.email}</td>
                  <td>{result.username}</td>
                </tr>
             
            )
          })}
           
            
          </tbody>
        </table>
       
            
      </div>
     
      </div>
        
      </>
    );
  }
}

export default RadnikPregledRez
